ユーザーと当ページとの間の通知または連絡は、当ページの定める方法によって行うものとします。当ページは、ユーザーから、当ページが別途定める方式に従った変更届け出がない限り、現在登録されている連絡先が有効なものとみなして当該連絡先へ通知または連絡を行い、これらは、発信時にユーザーへ到達したものとみなします。

